import React from 'react';
import produtos from '../../data/produtos';

export default (props) => {
    return (
        <table>
            <tr>
               {produtos.map((item) => {
                    return [
                        <td>{item.id}</td>,
                        <td>{item.produto}</td>,
                        <td>{item.preço}</td>
                    ];
                })}
            </tr>
        </table>
    )
}
